import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Admin from './Admin';
import CustomerTable from './CustomerTable'; // Import Customer Table
import OrderTable from './OrderTable'; // Import Order Table
import ProductTable from './ProductTable'; // Import Product Table

const App = () => {
  return (
    <Router>
      <Switch>
        {/* Customer Table Route */}
        <Route path="/admin/customers" component={CustomerTable} />
        
        {/* Order Table Route */}
        <Route path="/admin/orders" component={OrderTable} />
        
        {/* Product Table Route */}
        <Route path="/admin/products" component={ProductTable} />
      </Switch>
    </Router>
  );
};

export default App;
